import React from "react";
import advancers from "../images/advancers.png";
import carbonprint from "../images/carbonprint1.png";
import civildiscord from "../images/civil-discord.png";
import flippo from "../images/flippo.png";
import yse from "../images/yse-light.png";
import shewhocodes from "../images/shewhocodes-light.png";

import { Container, Row, Col } from "react-bootstrap";
import Card from "./Card";
function Projects() {
  return (
    <div>
      <Container fluid>
        <Row className="m-5 py-5">
          <Col className="card-pic mr-4">
            <Card pic={advancers} />
          </Col>
          <Col className="card-pic ml-4">
            <Card />
          </Col>
        </Row>

        <Row className="m-5 py-5">
          <Col className="card-pic mr-4">
            <Card />
          </Col>
          <Col className="card-pic ml-4">
            <Card />
          </Col>
        </Row>
      </Container>
    </div>
    // <div className="container-fluid d-flex justify-content-center">
    //   <div className="row">
    //     <div className="col">
    //       <Card />
    //     </div>
    //     <div className="col">
    //       <Card />
    //     </div>
    //   </div>
    // </div>
  );
}

export default Projects;
